use pro111;
CREATE TABLE Propertyinfo 
(
    Prop_ID INT,
    PropertyCity VARCHAR(13),
    PropertyState VARCHAR(13)
);
    
    CREATE TABLE Products (
    ProductID INT,
    ProductName VARCHAR(19),
    ProductCategory VARCHAR(15),
    Price INT
);
    
    CREATE TABLE OrderDetails (
    OrderID INT,
    OrderDate DATETIME,
    PropertyID INT,
    ProductID INT,
    Quantity INT
);
    
    Select * from Propertyinfo;
    Select * from Products;
    Select * from OrderDetails;
    
    Select PropertyID, max(Quantity) as max111 from OrderDetails
    group by PropertyID;
    
    Select Quantity, count(*) from OrderDetails;
    
    Select distinct ProductID, Quantity from OrderDetails
    group by ProductID;
    
    Select ProductCategory, count(*) from Products
    group by ProductCategory
    order by 2 desc;
    
    Select PropertyState, count(*) as COUNT from Propertyinfo
    group by PropertyState
    order by 2 desc;
    
    Select ProductID, sum(Quantity) as Total_Quantity
    from OrderDetails
    group by ProductID
    order by 2 desc
    limit 5;
    
    Select PropertyID,sum(Quantity) as Total111
    from OrderDetails
    group by PropertyID
    order by 2 desc
    limit 5;
    
    Select c.PropertyCity, a.ProductName, sum(a.Price * b.Quantity) as Sales
    from Products as a
    left join OrderDetails as b
    left join Propertyinfo as c on  b.ProductID=c.Prop_ID
    on a.ProductID=b.ProductID
    group by a.ProductName
    order by 3 desc
    limit 5;
    
    Select * from Products
    where ProductName IN
    (
    Select ProductName from Products 
	group by ProductName
    having sum(Price)<10
    );
    
    
    
    
    
    
    
    
    
    